import React from 'react';
import { Text, Div} from "atomize";


class Rarity extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
          showCollapse: false
        };
    }

    render() { 

        return (
            <Div
                m={{ b: "40px" }}
                align="left"
                justify="center"
            >
                <Text textSize="title" textWeight="500">Rarity Table</Text>

            </Div>
            )
    }
}

export default Rarity;
